import React from 'react';
import Form from 'react-bootstrap/Form'; 

export default function Login() {
  return (
    <>
    <div></div>
        <Form>
            <Form.Group className="mt-3 col-6" controlId="forname">
                <Form.Control type="text" placeholder="Enter your name"/>
            </Form.Group>
            <Form.Group className="mt-3 col-6" controlId="foremail">
                <Form.Control type="email" placeholder="Enter your email"/>
            </Form.Group>
            <Form.Group className="mt-3 col-6" controlId="forpassword">
                <Form.Control type="password" placeholder="Enter your name"/>
            </Form.Group>
        </Form>
    </>
  )
}
